import React from 'react'
const navigation = {
    name: 'Энциклопедия',
    links: [
        {
            name: 'Основы игры',
            link: 'google.com',
        },
        {
            name: 'Библиотека',
            link: 'google.com',
        },
        {
            name: 'Расы и классы',
            link: 'google.com',
        },
        {
            name: 'Локации',
            link: 'google.com',
        },
        {
            name: 'Предметы',
            link: 'google.com',
        },
        {
            name: 'Квесты',
            link: 'google.com',
        },
        {
            name: 'Монстры',
            link: 'google.com',
        },
    ]
};
const LeftMenu = () => (
    <aside className={'leftMenu-container'}>
        {Object.values(navigation).map((obj, key) =>
            <div key={key} className={'suggestions'}>
                <h2>{obj.name}</h2>
                <ul>
                    {(obj.links).map((link, key) => <li key={key}><a href={link.link}>{link.name}</a></li>)}
                </ul>
            </div>)}
    </aside>
);

export default LeftMenu
